import { FETCH_USERS } from '../actions';
import _ from 'lodash';

const initialState = {
    users: []
}

export default function(state = {}, action) {
    switch (action.type) {
        case FETCH_USERS:
            return _.mapKeys(action.payload.data)
        default:
            return state;
    }
}
